	const navigate = useNavigate();
	const handleLogin = () => {
		navigate('/');
	};
	useEffect(() => {
		if (localStorage.getItem('email')) {
			createDocumentRegistry.title = 'ホーム';
		} else {
			return { handleLogin };
		}
	}, []);
	if (localStorage.getItem('email')) {
		return <div>{localStorage.getItem('email')}</div>;
	} else {
		return { handleLogin };
	}
}

export default Home;
